import React, { useEffect } from 'react'
import CustomButton from "../custom/CustomButton";
import { PRIVATE_WHITE_COLOR, publicStyles } from "../types/publicStyles";
import CustomLabel from "../custom/CustomLabel";
import styled from "@emotion/styled";
import { useRouter } from "next/router";
import Cookies from 'js-cookie'


const Container = styled.div`
    width: 100%;
    height: 100vh;
    // background: transparent url('/images/landingBackground.png') no-repeat 0% 0%;
    background-size: 100% 100%;
`

const BlackOpacity = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #00000030;
  /* padding: 21pt; */

`

const logoImage = {
    width: '150pt',
    height: '100pt'
}

const HeaderContainer = styled.div`
  display: flex;
  justify-content: flex-end;
  width: 97%;
  position: absolute;
  top: 80px;
`

const LoginComponent: React.FunctionComponent = () => {

    const Header = () => (
        <HeaderContainer>
            <CustomButton text={'시작하기'} />
        </HeaderContainer>
    )

    const Content = () => (
        <div style={{
            ...publicStyles.startCenter,
            height: '100%',
            alignItems: 'center',
            justifyContent: 'center'
        }}>
            {
                <div style={{ textAlign: 'center' }}>
                    <img src={'/images/logo.png'} alt='logo' style={logoImage} />
                    <CustomLabel text={'과외 관리의 마침표'} fontSize={23} fontType={'pt'} color={PRIVATE_WHITE_COLOR} />
                </div>
            }
        </div>
    )

    return <Container>
        <BlackOpacity>
            {Header()}
            {Content()}
        </BlackOpacity>
    </Container>
}
export default LoginComponent
